import React from 'react';
import { Container, Form, Button, Card, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './loginform.css';

const LoginForm = () => {
  return (
    <Container className="d-flex flex-column align-items-center justify-content-center" style={{ height: "90vh" }}>
      <Card style={{ width: '400px', padding: '20px', border: "none" }}>
        <h4 style={{ textAlign: "center" }}>Login</h4>
        <Form className='login-form'>
          <Form.Group>
            <Form.Label>Email address</Form.Label>
            <Form.Control type="email" placeholder="Enter email" />
          </Form.Group>

          <Form.Group style={{ paddingBottom: "10px" }}>
            <Row>
              <Col xs={8}> {/* Column for the label */}
                <Form.Label>Password</Form.Label>
              </Col>
              <Col xs={1}> {/* Column for the "Forgot Password" button */}
                <Button variant="link" className="forgot-password-btn" style={{fontSize:"12px"}}>Forgot Password?</Button>
              </Col>
            </Row>
            <Form.Control type="password" placeholder="Enter Password" />
          </Form.Group>

          <Button variant="primary" type="submit" className='login'>
            LOGIN
          </Button>
        </Form>
      </Card>
    </Container>
  );
};

export default LoginForm;
